import React, {memo} from 'react';
import styled from 'styled-components';

const ListViewContainer = styled.div`
    .contentContainer{
        max-width:1200px;
        margin:120px auto 80px;

        .contentWrap{
            width:100%;
            height:auto;
            

            .contentInner{
                padding:0 20px;
                border-top:2px solid #333333;
                border-bottom:1px solid #B3B3B3;

                .title{
                    font-size:24px;
                    display: flex;
                    align-items: center;
                    height: 80px;
                    border:0;
                    
                    &:focus{outline:none;}
                }

                .content{
                    width:100%;
                    height: auto;
                    border:0;
                    
                    &:focus{outline:none;}
                }
            }
        }
    }
`;

const ListView = memo(() => {
    return (
        <ListViewContainer>
            <div className='contentContainer'>
                <form className='contentWrap'>
                    <div className='contentInner'>
                        <input className='title' name='title' />
                        <hr className='divider' />
                        <textarea className='content' name='content' />
                    </div>
                    <div className='btnWrap'>
                        <button type='submit' className='btn edit'>목록</button>
                        <button type='submit' className='btn edit'>수정</button>
                        <button type='submit' className='btn edit'>삭제</button>
                    </div>
                </form>
                
            </div>
        </ListViewContainer>
    );
});

export default ListView;
